import{_ as t,a,b as o,c as r,d as i,e as n,f as l}from"./chunks/qgc_firmware_standard_vtol_fun_cub_quad.CBKDMaZ8.js";import{_ as s,c as d,a8 as h,o as p}from"./chunks/framework.BDnHobkS.js";const _=JSON.parse('{"title":"Volantex Ranger-Ex QuadPlane VTOL (Pixhawk)","description":"","frontmatter":{},"headers":[],"relativePath":"zh/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md","filePath":"zh/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md"}'),u={name:"zh/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md"};function c(m,e,g,b,f,x){return p(),d("div",null,e[0]||(e[0]=[h('<h1 id="volantex-ranger-ex-quadplane-vtol-pixhawk" tabindex="-1">Volantex Ranger-Ex QuadPlane VTOL (Pixhawk) <a class="header-anchor" href="#volantex-ranger-ex-quadplane-vtol-pixhawk" aria-label="Permalink to &quot;Volantex Ranger-Ex QuadPlane VTOL (Pixhawk)&quot;">​</a></h1><p>The QuadRanger VTOL is a standard tailplane aircraft based on the Volantex Ranger-Ex that has been retrofitted with a QuadCopter system. The Ranger-Ex is an easy to fly FPV platform that is widely available. It is also available from HobbyKing where it is rebranded as the Quanum Observer. The plasic fuselage and 2 meter EPO wing makes it a rugged airframe with a lot of payload capacity.</p><p>Key information:</p><ul><li><strong>Frame:</strong> Volantex Ranger-Ex or <em>Quanum Observer</em></li><li><strong>Flight controller:</strong> Pixhawk</li></ul><p><img src="'+t+'" alt="QuadRanger"></p><p>The VTOL conversion makes the plane a bit heavier (around 3.5kg including LiPo). With this conversion the plane will cruise at approximately 65% throttle. The suggested quad setup provides a thrust of 7.5kg and the airframe can fly with a total weight of around 4.5kg. This leaves enough payload capacity for payloads like FPV gear and cameras.</p><p>The conversion is designed to minimize impact on the aerodynamics and provide additional strength minimize wing flexing.</p><h2 id="bill-of-materials" tabindex="-1">Bill of Materials <a class="header-anchor" href="#bill-of-materials" aria-label="Permalink to &quot;Bill of Materials&quot;">​</a></h2><ul><li>Volantex Ranger-Ex or Quanum Observer</li><li>1200KV 530W motors</li><li>30A Speed Controllers</li><li>4s battery</li><li>APC Electric 11x5 propellers</li></ul><h2 id="conversion-kit" tabindex="-1">Conversion kit <a class="header-anchor" href="#conversion-kit" aria-label="Permalink to &quot;Conversion kit&quot;">​</a></h2><ul><li>The basic parts required are;</li><li>Pixhawk or compatible</li><li>数字空速传感器</li><li>3DR Power module or compatible</li><li>GPS</li></ul><p>For a full parts list with links to Hobbyking EU and International warehouse see: <a href="https://px4.io/wp-content/uploads/2016/01/QuadRanger-VTOL-partslist-1.xlsx" target="_blank" rel="noreferrer">QuadRanger-VTOL-partslist</a></p><p>The image below depicts the parts required for one wing.</p><p><img src="'+a+'" alt="QuadRanger Parts"></p><p>The tools required for the conversion are;</p><ul><li>A Dremel or similar rotary tool</li><li>A hobby knife</li><li>UHU POR glue</li><li>CA glue</li><li>Tape-line</li><li>Tape</li></ul><p><img src="'+o+'" alt="QuadRanger conversion tools"></p><h2 id="wing-conversion" tabindex="-1">Wing conversion <a class="header-anchor" href="#wing-conversion" aria-label="Permalink to &quot;Wing conversion&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Please note that the conversion in this build log is performed on a wing that shows damage from a previous conversion.</p></div><p>Cut both 800mm square carbon tubes to a length of 570mm and 230mm.</p><p>Making a slot in the Styrofoam wing 1.5cm deep using a rotary tool with some form of guidance to keep a fixed depth. The slot should be the length, depth and width of one 230mm square carbon tube. It should be located as indicated below.</p><p><img src="'+r+'" alt="QuadRanger carbon tube slot"></p><p>Glue the 300x150x1.5mm carbon sheet to the 230mm carbon tube using CA glue and create an opening to run wires through. Insert the wires for power and signal to the ESC&#39;s. Using UHU POR glue the sheet and carbon tube to the Styrofoam wing as indicated below.</p><p><img src="'+i+'" alt="QuadRanger sheet attachment"></p><p>Using CA glue, glue the 570mm square carbon tube to the carbon sheet. It should be located 285mm from where the wings join. The tube should be centred relative to the vertical area of the wing. It should extend exactly 165mm on both sides.</p><p>Attach the motor mount to the motor. With another motor mount plate and 4 M3x25mm screws clamp the motor on the end of the square carbon tube as indicated below. Attach the ESC&#39;s with tie wraps to the carbon tube. When using the Afro ESC be sure to connect at least signal and ground wire.</p><p><img src="'+n+'" alt="QuadRanger motor and esc"></p><h2 id="布线" tabindex="-1">布线 <a class="header-anchor" href="#布线" aria-label="Permalink to &quot;布线&quot;">​</a></h2><p>The outputs of Pixhawk should be wired like this (orientation as seen like &quot;sitting in the plane&quot;).</p><table tabindex="0"><thead><tr><th>Port</th><th>接口定义</th></tr></thead><tbody><tr><td>MAIN 1</td><td>Front right motor, CCW</td></tr><tr><td>MAIN 2</td><td>Back left motor, CCW</td></tr><tr><td>MAIN 3</td><td>Front left motor, CW</td></tr><tr><td>MAIN 4</td><td>Back right motor, CW</td></tr><tr><td>AUX 1</td><td>Left aileron</td></tr><tr><td>AUX 2</td><td>Right aileron</td></tr><tr><td>AUX 3</td><td>Elevator</td></tr><tr><td>AUX 4</td><td>Rudder</td></tr><tr><td>AUX 5</td><td>油门</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The servo direction can be reversed using the PWM_REV parameters in the PWM_OUTPUT group of QGroundControl (cogwheel tab, last item in the left menu)</p></div><p>For further instructions on wiring and configurations please see: <a href="./../config_vtol/vtol_quad_configuration.html">Standard VTOL Wiring and Configuration</a></p><h2 id="配置" tabindex="-1">配置 <a class="header-anchor" href="#配置" aria-label="Permalink to &quot;配置&quot;">​</a></h2><p>Configure the frame as shown in QGroundControl below (do not forget to click <strong>Apply and Restart</strong> in the top).</p><p><img src="'+l+'" alt="QGC - select firmware for standard VTOL"></p><h2 id="技术支持" tabindex="-1">技术支持 <a class="header-anchor" href="#技术支持" aria-label="Permalink to &quot;技术支持&quot;">​</a></h2><p>If you have any questions regarding your VTOL conversion or configuration please visit <a href="https://discuss.px4.io/c/px4/vtol" target="_blank" rel="noreferrer">https://discuss.px4.io/c/px4/vtol</a>.</p>',37)]))}const k=s(u,[["render",c]]);export{_ as __pageData,k as default};
